import React from "react";
import Specials from "./Specials"
import {money} from "./Contact"
function Gallery()
{
    return(
        <>
        <money.Consumer>
            {(name)=>{
                 return(<h1>B is Component={name}</h1>)
            }}
            
        </money.Consumer>
        <Specials></Specials>
        </>
    )
}
export default Gallery;
